import css from 'styled-jsx/css'

export default css.global `


`

export const blog = css`
ul {
    list-style: none;
    margin: 0;
}

a {
    text-decoration: none;
    font-size: 2rem;
    font-family: 'Amatic SC';
    font-weight: bold;    
}

li {
    margin: 2rem;
    padding-bottom: .5rem;
    border-bottom: 1px solid lightgrey;
    width: 100%;   
}

span {
  font-family: 'Poiret One';
  font-weight: bold;
  float:right;
  padding-top: 15px;
}`

export const post = css  `
h1 {
    text-align: center;
    border-bottom: 1px solid lightgrey;
}
article {
    font-family: Verdana;
    width: 60%;
    margin: 0 auto;
    text-align: justify;
}
`
